					"Room": "Bldg B, Lvl 5, Murphy BR 1-2",
					"SessionDescription": "Dr. Monika Brüggemann will review the different techniques used to measure minimal residual disease (MRD), focusing on the benefits and limitations of each method. She will highlight the importance of MRD as a prognostic factor in the setting of chemotherapy, stem cell transplantation, and immunotherapeutic drugs. Dr. Brüggemann will give an overview of MRD-driven therapeutic concepts and discuss whether and how MRD can be used as a decisive treatment tool.</p>\n<p>Dr. Farhad Ravandi will review the recently reported clinical trials in Philadelphia chromosome positive acute lymphocytic leukemia (ALL) and discuss the pros and cons of the strategies reported, comparing the results obtained by various tyrosine kinase inhibitors (TKIs). He will examine the potential role of allogeneic stem cell transplant in the context of these TKI-based regimens and discuss how monitoring levels of BCR-ABL transcripts may potentially assist in making the decision to proceed to an allogeneic stem cell transplant in first remission.</p>\n<p>Dr. Wendy Stock will review new treatment strategies for specific disease subsets in adult ALL, ranging from targeted TKIs to immune-based therapies, such as antibody conjugates, bispecific engaging antibodies, and chimeric antigen receptor (CAR) T cells. She will describe potential treatment algorithms as well as strategies for moving these agents, currently approved or being tested in the setting of relapsed disease, into the frontline treatment of ALL to eradicate MRD and improve treatment outcomes and survival.",
