					"SessionDescription": "The characterization, diagnosis, prognosis, and treatment options for acute myeloid leukemia (AML) have evolved tremendously over the last decade. For the first time in years, new agents have been approved for the treatment of AML.</p>\n<p>Dr. Eli Pappaemanuil will discuss the value of molecular and cytogenetic studies in AML patients in allowing us to better understand the nature of the disease, its prognosis, and the studies that are useful in assessing a patient.</p>\n<p>Dr. Herve Dombret will discuss the use of intensive chemotherapy or hypomethylating agent therapy for AML. He will provide guidance regarding the choice of therapy and the factors that contribute to the decision, with a focus on the elderly.</p>\n<p>Dr. Alexander Perl will discuss the approach to the treatment of AML in the era of targeted therapies. He will discuss the role of newly approved agents, agents currently under investigation, and the necessary diagnostic studies needed.",
