					"Room": "Bldg C, Lvl 1, Hall C4",
					"SessionDescription": "Chimeric antigen receptor (CAR) T-cell immunotherapies offer promise for the effective treatment of lymphoid malignancies. Recent developments seek to improve the efficacy, specificity, response durability, and safety of CAR T-cell therapies and expand their therapeutic indications. </p>\n<p>Dr. Gianpietro Dotti will discuss the role of antigen selection and T-cell source in targeting hematologic malignancies using CARs. The field has been largely dominated by the adoptive transfer of T cells expressing the CD19-specific CAR in acute lymphoid leukemia and non-Hodgkin lymphomas. More recently, other target antigens have been tested in phase I studies with the aim of either mitigating the B-cell aplasia caused by CD19-specific CAR T cells in B-lymphoid malignancies or of targeting other malignancies non-expressing CD19. Two new targets, such as k-light chain of human immunoglobulins to target B-cell lymphomas and CD30 to target Hodgkin lymphoma, will be discussed. While polyclonal activated T cells are frequently used in clinical trials, other sources such as natural killer T cells can potentially be explored, and these will also be discussed.</p>\n<p>Dr. Cameron Turtle will discuss response and toxicity data from a clinical trial studying immunotherapy in patients with B-cell malignancies using a defined composition of CD4+ and CD8+ CD19-targeted CAR T cells. Cytokine release syndrome and neurologic toxicity are complications that can occur in patients treated with CD19 CAR T cells. Our understanding of these syndromes is evolving, along with strategies to identify those at high risk of toxicity in whom early intervention or other mitigation strategies may be indicated.</p>\n<p>Dr. Crystal Mackall will discuss the factors limiting the efficacy of CAR T-cell therapies, including primary and secondary resistance due to tumor-associated or T cell-associated factors. Antigen loss escape is a major factor associated with acquired resistance to CAR T-cell therapeutics. The biologic basis for such escape and approaches to diminish this phenomena will be discussed. T-cell exhaustion can also significantly limit the efficacy of CAR T-cell therapeutics. Recent insights into the biology of T-cell exhaustion and novel approaches to ameliorate this phenomena in the context of adoptive cell therapies will be discussed.",
