					"SessionDescription": "<h3>William Dameshek Prize</h3>\n<p>The William Dameshek Prize, named for the late William Dameshek, MD, a past president of ASH and the original editor of <em>Blood</em>, recognizes an early- or mid-career individual who has made a recent outstanding contribution to the field of hematology.</p>\n<p><strong>The 2017 William Dameshek Prize will be awarded to Benjamin Ebert, MD, PhD</strong>, of Brigham and Women’s Hospital in Boston, MA, for his seminal discoveries in multiple areas of malignant hematology. Dr. Ebert has been noted for his leadership role in describing the genomic landscape of adult myelodysplastic syndromes. His lab has made significant contributions to understanding the biological basis of transformation of hematopoietic cells by somatic mutations. Dr. Ebert also published the first studies on CRISPR/Cas9 genome editing in hematopoietic stem cells to create novel models of hematologic malignancy. His work has displayed creativity, innovative methodology, and most importantly, direct human relevance. Many of his findings have been directly translated to the clinic as diagnostic tests or therapeutic targets.</p>\n<h3>Henry M. Stratton Medal</h3>\n<p>The Henry M. Stratton Medal is named after the late Henry Maurice Stratton, co-founder of Grune and Stratton, the medical publishing house that first published ASH’s journal <em>Blood</em>. The prize honors two senior investigators whose contributions to both basic and clinical/ translational hematology research are well recognized and have taken place over a period of several years.</p>\n<p><strong>The 2017 Henry M. Stratton Medal for Basic Research will be awarded to Josef Prchal, MD</strong>, of the University of Utah in Salt Lake City, UT, for his contributions to the fundamental understanding of both primary and secondary polycythemias. Dr. Prchal’s many innovations in the field include the description of the von Hippel-Lindau (VHL) mutation in recessive Chuvash familial polycythemia and elaboration on the pathobiology of erythropoietin receptor (EPOR) mutations in autosomal dominant familial polycythemia. His genetic investigations of acquired polycythemia vera led to the association of chromosome 9p abnormalities – where the JAK2 gene is located – with the disease. More recently, Dr. Prchal and his collaborators showed that Tibetans are protected from high altitude polycythemia as a result of a high altitude genetic adaptation due to a variant EGLN1 gene.</p>\n<p><strong>The 2017 Henry M. Stratton Medal for Clinical/Translational Research will be awarded to Sherrill Slichter, MD</strong>, of the University of Washington School of Medicine in Seattle, WA, for her major contributions to the field of transfusion medicine over a period of more than 40 years. Dr. Slichter’s research contributions include the evaluation of methodologies for platelet storage prior to transfusion, the development of guidelines for prophylactic platelet transfusion, pre-transfusion treatment of platelets to reduce immunogenicity, the characterization of platelet kinetics in various disease states, especially autoimmune thrombocytopenia, and the evaluation of various commercial systems for preservation of platelets and other blood cells prior to transfusion. Her research efforts have helped improve current standards of platelet preservation and transfusion around the world, culminating in the execution of a large clinical study that provided an objective threshold for platelet transfusion. Her studies have also been critical to optimizing transfusion practices.",
