					"Room": "Int'l Blrm, No. Twr, M2",
					"SessionDescription": "The ASH Practice Partnership is the Society’s network of practice-based hematologists with interests in practice-related policies, quality of care, new health care delivery systems, and practice management issues. The ASH Practice Partnership Lunch is a special session designed for this community.</p>\n<p>A December 2015 study from the Mayo Clinic reported that physician burnout is on the rise; across all medical specialties, the physician burnout rate rose from 45 percent in 2011 to 54 percent in 2014. In 2015, <i>ASH Clinical News</i> reported in \"Beating Burnout: When Clinicians Are Overworked, Overtired, and Overwhelmed\" that the most common complaints among today’s practicing hematologists are delayed, inadequate, and reduced reimbursement, high staff turnover, poor recruitment and retention, and understaffing – all causes of burnout. Reports indicate that the advent of electronic health records and federal reporting mandates have added to physician burnout and that the implementation of the Medicare Access and CHIP Reauthorization Act (MACRA) has the potential to create additional burden, especially for small practices lacking in administrative resources. Speakers will address the problem of physician burnout and focus on sustainability, proposing coping methods and potential solutions.",
