					"SessionDescription": "Defining the molecular progression from a preleukemic state to overt malignancy is one of the most pressing scientific questions under current investigation. This session will focus on several systems in which the clonal evolution of myeloid malignancies is being defined.</p>\n<p>Dr. Christina Curtis will discuss approaches for quantifying the evolutionary dynamics of tumor progression in a patient-specific manner. She will describe how a population genetics framework can be used to quantify the signals of selection embedded in cancer genomes in order to classify distinct modes of tumor evolution. Dr. Curtis will also describe the attendant clinical implications that can forecast tumor progression.</p>\n<p>Dr. Timothy Ley will describe his current work on the combinatorial complexity in the acquired genetic mutations found in acute myeloid leukemia (AML) and the application of molecular insights into patients with intermediate-risk AML with unpredictable outcomes. He will address methods to assess subclonal structure, how assessment regarding the clearance of subclones from each patient is being tested in an ongoing clinical trial, and how this work may improve risk prediction.</p>\n<p>Dr. Daniel Link will discuss emerging questions concerning the development of clonal hematopoiesis, including what drives expansion of hematopoietic clones, what role external hematopoietic stressors, such as exposure to chemotherapy, play in the development of clonal hematopoiesis, why so few people with clonal hematopoiesis develop a myeloid malignancy, and whether certain mutations confer a higher risk of transformation.</p>\n<p>Dr. Anna Brown will discuss clonal evolution in the context of germline hematological malignancy predisposition syndromes as well as the adaptation to stress that may trigger this evolution. She will address whether genetic and/or epigenetic clonal adaptation act to revert antecedent cytopenias and immunodeficiency or whether they constrain expression of the germline mutated allele and alter disease penetrance in carriers. Other clonal evolution triggers, such as infection or stem cell transplantation, that may lead to malignancy onset will also be discussed.",
