					"SessionDescription": "Neutropenia is a frequent, challenging clinical event encountered by both adult and pediatric hematologists and hematopathologists. Accurate diagnosis and effective management is sometimes delayed, which may be problematic because the causes can be life-threatening. This session will summarize new disease entities, new mechanisms that illuminate broader hematologic issues, and new clinical strategies to manage these diverse patients.</p>\n<p>Dr. Seth Corey will summarize newly discovered congenital causes for severe or moderate neutropenia and review the controversies in their diagnosis and management, with particular focus on their predisposition to malignant transformation.  </p>\n<p>Dr. Thomas Loughran will review the diagnostic criteria and pathogenesis of large granular lymphocytic (LGL) leukemia, with a particular focus on the overlap of LGL leukemia and rheumatoid arthritis, especially Felty syndrome. Current understanding of the mechanisms of neutropenia in rheumatoid arthritis will be discussed. Finally, treatment indications and therapeutic recommendations will be outlined.</p>\n<p>Dr. Brian Curtis will summarize the proposed mechanisms, incidence, and risk factors of drug-induced neutropenia (DIN). He will list the drugs most commonly associated with DIN and briefly review the utility of laboratory testing for drug-dependent antibodies in suspected cases of DIN.",
