					"Room": "Bldg C, Lvl 1, Hall C4",
					"SessionDescription": "Although the prognosis for many children and adolescents with leukemia has significantly improved over the last several decades, important care challenges remain. This session will provide an overview on the diagnosis and management of patients with syndromes associated with increased susceptibility to leukemia. Treatment-related complications will be covered, in addition to current approaches to incorporating novel therapies in the treatment of childhood acute lymphocytic leukemia (ALL).</p>\n<p>Dr. Sharon Savage will review classic syndromes and more recently described entities associated with increased susceptibility to leukemia. She will discuss in whom a work-up of an inherited predisposition to leukemia should be undertaken, the major clinical findings in these syndromes, and the challenges in managing acute leukemia, including stem cell transplant, in these patients.</p>\n<p>Dr. Rachael Hough will describe treatment-related complications in childhood ALL, focusing on the presentation, pathogenesis, risk factors, and management of the most common life-threatening toxicities. She will also provide an update on research related to prevention of these complications.</p>\n<p>Dr. Lewis Silverman will provide an overview of non-chemotherapeutic approaches currently being tested in childhood ALL. This includes targeted therapies, such as tyrosine kinase inhibitors, and immunotherapies, such as antibodies and chimeric antigen receptor (CAR) T cells. Dr. Silverman will review recently conducted clinical trials and ongoing efforts to incorporate these novel therapies into the upfront treatment for children and adolescents with ALL.",
