					"SessionType": "Oral",
					"Sponsor": "Ernest Beutler Lecture and Prize",
					"StartTime": "1:30:00 PM",
					"TitleNote": "Turning Foes Into Friends: Exploiting HIV to Generate Efficient and Safe Vectors to Cure Inherited and Acquired Blood Diseases",
