					"Room": "Bldg B, Lvl 5, Murphy BR 3-4",
					"SessionDescription": "A unique property of hematopoietic stem cells (HSCs) is their ability to generate all blood cell lineages for the lifetime of a recipient after HSC transplantation. Because of this, HSCs present an ideal target for many HSC gene therapy approaches for hemoglobinopathies, many immunodeficiencies, and other genetic disorders affecting the hematopoietic system. There has been tremendous progress in the development of vector systems for HSC gene therapy, with clear therapeutic benefit for some diseases. More recently, there has also been significant progress in gene editing technologies using various nuclease platforms. While there are many different approaches to modifying and correcting HSCs, the conditioning regimen has been a critical component for engraftment and persistence of HSCs and their progeny. The most current approaches use alkylating agents to facilitate engraftment, and in many cases, near-myeloablative doses are required for efficient engraftment and persistence of gene-modified and gene-corrected cells. While the use of alkylating agents have some advantages in eliminating or reducing any remaining cancer cells before transplantation, this would not be necessary or required for HSC gene therapy for genetic diseases. An ideal conditioning regimen for HSC gene therapy in patients with genetic diseases would be based on non-genotoxic reagents and conditions. Several approaches have recently been described and will be discussed in this session.</p>\n<p>Dr. Philip Gregory will discuss advances in vector development and translation to clinical protocols and the role of gene editing technology for HSC gene therapy.</p>\n<p>Dr. Hiromitsu Nakauchi will present a novel concept for non-genotoxic conditioning based on the role of valine in HSC maintenance and will discuss how valine restriction might facilitate HSC engraftment.</p>\n<p>Dr. Judith Shizuru will discuss novel non-genotoxic conditioning approaches for HSC gene therapy using antibody-based conditioning.",
