					"Room": "Bldg A, Lvl 4, A411-A412",
					"SessionDescription": "Study of the classic inherited bone marrow failure diseases Fanconi anemia, dyskeratosis congenita, and Shwachman-Diamond syndrome have provided major insights into DNA repair, telomere maintenance, and ribosome biogenesis. This session will focus on recent advances that provide new insights into mechanisms the lead to stem cell failure and leukemogenesis.</p>\n<p>Dr. Inderjeet Dokal will discuss recent studies that have led to the identification of the new bone marrow failure disease genes <i>DNAJC21</i> and <i>ERCC6L2</i>. Functional studies suggest that <i>DNAJC21</i> is crucial for 60S ribosome maturation (and therefore ribosome biogenesis), and that <i>ERCC6L2</i> is important in the DNA damage response and mitochondrial function. Collectively, these discoveries bring into focus new biological connections and pathways whose constitutional disruption is associated with defective hematopoiesis.</p>\n<p>Dr. Steven Holland will discuss germline haploinsufficiency of <i>GATA2</i> that leads to several well-recognized immunodeficiency syndromes associated with eventual loss of monocytes, dendritic cells, B and natural killer lymphoid cells. It is also critical for endothelial development and is associated with later-onset lymphedema. <i>GATA2</i> mutations are also associated with a broad hematological phenotype that includes an increased risk of developing myelodysplastic syndrome (MDS) and acute myeloid leukemia (AML), acute lymphocytic leukemia (ALL), chronic myelomonocytic leukemia (CMML), aplastic anemia, or neutropenia. Recent genetic, molecular, and cellular studies show some genotype-phenotype correlations, especially around lymphedema. There are also important effects of specific mutations on penetrance, with intronic mutations carrying lower rates of penetrance. The pathophysiological mechanisms that lead to different aspects of the disease are still emerging. Bone marrow transplantation has been highly effective at arresting the hematologic, virologic, and pulmonary manifestations of the disease, but so far the lymphatic components have not been affected. <i>GATA2</i> haploinsufficiency remains a complex and protean disease.</p>\n<p>Dr. Marc Raaijmakers will discuss emerging insights into hematopoietic cell non-autonomous contributions to bone marrow failure and leukemogenesis. Shwachman-Diamond syndrome, characterized by bone and blood abnormalities, has a striking propensity for leukemic transformation, and its monogenic origin provides a unique model disease to explore this concept. Data from mouse models and human disease will be presented with an emphasis on inflammatory signaling in the hematopoietic stem cell niche and its broader significance to other bone marrow failure and leukemia predisposition syndromes.",
