					"SessionDescription": "This session will highlight the inspiring and innovative work of hematologists around the world to combat blood diseases in low-resource settings. Hear from the individuals leading these initiatives, and learn about the research, training, and clinical practices that drive efforts to deliver health care to some of the world’s most disadvantaged populations. Attendees will also learn how they can make an impact on hematology care in other regions through ASH’s international outreach programs.",
