					"SessionDescription": "The Hematology Course Directors’ Workshop will continue to offer practical tips and a place of camaraderie for those involved with teaching hematology to medical students. The workshop will focus on pedagogy, new techniques, scholarship on a yearly basis, and a highlight of one participant’s project from the 2016 ASH Medical Educators Institute. Topics to be covered include Knowles’ adult learning theory, a pro and con discussion on the flipped classroom, and an examination of qualitative research methodology.<b> </b>",
