					"Room": "Bldg A, Lvl 4, A411-A412",
					"SessionDescription": "Studies of the hematopoietic system have pioneered stem cell research, and HSC transplantation has provided increasingly effective curative treatments for malignant and non-malignant diseases over many decades. Recent research breakthroughs provide opportunities for continued improvement in stem cell therapies as well as their broader application. Improved strategies for <i>ex vivo</i> generation and expansion of hematopoietic stem and progenitor cells promise to significantly impact transplantation therapy and will likely be necessary for effective application of genome editing to regenerative medicine. This session will focus on recent advances in <i>ex vivo</i> hematopoietic reprogramming and HSC expansion.</p>\n<p>Dr. Kateri Moore will address transcription factor-mediated reprogramming of somatic cells to hematopoietic cells. Similarities between the reprogramming process and developmental hematopoiesis will be discussed, and Dr. Moore will present studies showing that the same three transcription factors effective in reprogramming murine cells will also reprogram human fibroblasts into hematopoietic stem and progenitor cells. Gene expression analyses at different time points of reprogramming will also be presented along with chromatin immunoprecipiation-sequencing studies to explore how these transcription factors remodel chromatin and reset the epigenetic landscape to initiate cell fate changes into a hemogenic program.</p>\n<p>Dr. Jonas Larsson will discuss the application of RNAi screens and chemical compound to identify modifiers of human hematopoietic stem and progenitor cell self-renewal under <i>ex vivo</i> culture conditions. He will describe two distinct categories of modifiers – epigenetic regulators and culture-induced stress response genes, and discuss strategies to target these factors to enhance the <i>ex vivo</i> propagation of HSCs. Dr. Larsson will also discuss work to define phenotypic markers that can precisely identify HSCs in culture, as well as strategies to more efficiently assay human HSCs <i>in vivo</i> using xenograft models and cellular barcoding.</p>\n<p>Dr. Kristin Hope will discuss the engineering of cellular pathways as a means to achieve <i>ex vivo</i> HSC expansion with a particular focus on modulation of the post-transcriptional circuitry. HSC homeostasis is subject to post-transcriptional control by RNA-binding proteins, which work to ensure precise regulation of gene expression by modulating mRNA splicing, polyadenylation, localization, degradation, or translation. Dr. Hope will summarize advances that capitalize on functional approaches and unbiased transcriptome and proteome-scale methods to define the tenets that govern this regulation. She will also summarize key downstream circuitries of HSC-regulating RNA-binding proteins whose targeting could provide the basis for novel regenerative treatments.",
