					"Room": "Bldg C, Lvl 1, Hall C2-C3",
					"SessionDescription": "Tremendous progress in our understanding of the biology of both classical and nodular lymphocyte-predominant Hodgkin lymphoma has resulted in significant efforts to rapidly translate this knowledge into new prognostic and therapeutic approaches. This session will focus on recent discoveries, potential advantages and pitfalls of novel therapies, and approaching nodular lymphocyte-predominant Hodgkin lymphoma as a distinct disease.</p>\n<p>Dr. Margaret Shipp will summarize recent advances in the understanding of Hodgkin lymphoma biology and explain how these discoveries open up potential avenues for developmental therapeutics. She will discuss how complex genetic alterations in Reed Sternberg cells lead to aberrant expression of PDL1, PDL2, beta-2 microglobulin, and major histocompatibility complex class I/II, as well as immune evasion and altered responsiveness to standard therapies and targeted agents.  </p>\n<p>Dr. Nancy Bartlett will discuss the role of brentuximab vedotin and the PD-1 inhibitors nivolumab and pembrolizumab in the treatment of multiple relapsed and refractory Hodgkin lymphoma. She will summarize recent results and current trials incorporating these agents into earlier lines of therapy and examine the potential advantages and disadvantages of new combinations. Dr. Bartlett will provide a brief review of novel agents in development, including chimeric antigen receptor (CAR) T-cell therapy, bispecific antibodies, and kinase inhibitors. </p>\n<p>Dr. Dennis Eichenauer will describe the unique natural history and biology of nodular lymphocyte-predominant Hodgkin lymphoma and address controversies and challenges in the management of both newly diagnosed and relapsed disease. He will emphasize why approaches used in classical Hodgkin lymphoma may not always represent the optimal strategy for treating this distinct subtype of lymphoma.",
