					"Room": "Bldg B, Lvl 2, B211-B212",
					"SessionDescription": "The contact pathway of coagulation is known to have a dispensable role in hemostasis. It also contributes to thrombosis, inflammation, innate immunity, and other pathological conditions. This session will focus on newly identified entities that modulate contact activation and inflammation in pathophysiologic disease states. Biochemical mechanisms and potential therapeutic interventions will be presented.</p>\n<p>Dr. James Morrissey will discuss the cellular sources of polyphosphate and their roles in modulating the blood clotting and complement pathways in hemostasis, thrombosis, and inflammation. Microbial polyphosphate is suspected of having roles in host-pathogen interactions, while polyphosphate released during cell and tissue injury may be one of the damage-associate molecular patterns (DAMPs) contributing to trauma-induced coagulopathy. Dr. Morrissey will discuss polyphosphate as a potential antithrombotic drug target.</p>\n<p>Dr. Patricia Liaw will present how mediators such as damage-associated molecular patterns have a crucial role in the pathogenesis of disseminated intravascular coagulation.  Upon cell death and/or cell activation, extracellular DNA and DNA-binding proteins are released into circulation. These molecules influence hemostasis by inducing platelet aggregation, promoting coagulation activation, activating endothelial cells, and inhibiting fibrinolysis. Basic and translational studies will be presented to provide insights into extracellular DNA and DNA-binding proteins as targets for intervention.</p>\n<p>Dr. Strickland will relate how amyloid-β peptide (Aβ) influences CNS hemostasis and thrombosis in the pathogenesis of Alzheimer’s disease (AD). Aβ, a causative factor in AD, is a contact system activator and inhibits fibrinolysis leading to brain inflammation and persistent fibrin clots, which contribute to the neurodegeneration and cognitive decline observed in AD. In AD mouse models, contact system inhibition and reducing fibrin levels ameliorates AD pathology. These effects of Aβ suggest new therapeutic strategies to treat AD as a thrombo-hemorrhagic disorder.",
