					"Room": "Bldg C, Lvl 1, Hall C1",
					"SessionDescription": "The management of chronic lymphocytic leukemia (CLL) has been revolutionized by the recent approval of highly effective, well-tolerated novel agents and by an improved understanding of CLL genomics. This session will review how CLL genomics and clonal evolution affect prognosis and treatment. Recent advances in frontline CLL therapy will be reviewed, including strategies for how to integrate novel agents. Lastly, the speakers will discuss approaches to the sequence of administration of novel agents and the optimization of combination regimens for CLL.</p>\n<p>Dr. Gianluca Gaidano will discuss how major advances in the understanding of CLL genomics have led to the clarification of the mutational landscape of the disease and of its clonal evolution over time. He will review how such molecular knowledge has expanded the availability of prognostic and predictive biomarkers that can be used for patient counseling, treatment tailoring, and clinical trial design. </p>\n<p>Dr. Kirsten Fischer will summarize recent clinical advances in frontline therapy of CLL. She will discuss the opportunities and challenges associated with the advent of targeted therapies and will provide recommendations on how to optimize frontline therapy based on clinical and biological factors.</p>\n<p>Dr. Matthew Davids will review recent data on the approved novel agents for CLL, including those targeting the B-cell receptor kinases, B-cell leukemia/lymphoma 2, and CD20. He will discuss strategies for sequencing novel agent monotherapy in different CLL patient populations and highlight some of the promising combination regimens incorporating novel agents that are currently under investigation.",
