					"Room": "Bldg C, Lvl 1, Hall C2-C3",
					"SessionDescription": "The management of indolent lymphoma remains a mixture of art and science. Biologic discoveries are uncovering the underlying pathogenesis of these diseases and beginning to influence the clinical decision making for individual patients. This session will focus on the management of these diseases as it relates to recent biologic advances. </p>\n<p>Dr. Brad Kahl will review follicular lymphoma, focusing on risk stratification. Follicular lymphoma is an incredibly heterogeneous disease, and decision making for individual patients is challenging. Dr. Kahl will review available tools to aid in patient management algorithms. He will also summarize outcomes with contemporary treatments and discuss when alternative strategies, such as stem cell transplantation, should be considered.</p>\n<p>Dr. Jorge Castillo will review recent biologic discoveries into the underlying pathogenesis of lymphoplasmacytic lymphoma such as <i>MYD88</i> and <i>CXCR4</i> mutations and discuss how these mutations affect treatment response to targeted agents such as Bruton tyrosine kinase inhibitors. He will review the management of these challenging disorders, focusing on how to integrate novel targeted agents into treatment algorithms where standard agents are also effective. </p>\n<p>Dr. Catherine Thieblemont will discuss both nodal and splenic marginal zone lymphoma. Each entity is relatively rare, creating challenges for biologic discovery and for conducting clinical trials. Single agent rituximab appears uniquely effective in splenic marginal zone lymphoma and is challenging the role of splenectomy. Ibrutinib appears to have impressive activity in nodal marginal zone lymphoma and is a newly available treatment option. Dr. Thieblemont will review the management of these two disorders.",
