					"Room": "Bldg C, Lvl 2, C211-C213",
					"SessionDescription": "Iron plays an essential role in hemoglobin synthesis as well as other critical biological processes such as oxygen transport, ATP generation, and DNA metabolism. Erythroid precursors satisfy their extreme iron requirements through receptor-mediated endocytosis of iron-bound transferrin, which is routed to mitochondria for heme synthesis and Fe-S cluster biogenesis. Other cell types also express molecules dedicated to the transport, utilization, and storage of iron. As a result, disruptions in iron trafficking can result in various forms of anemia and cause pathology in other organs. This session will discuss current knowledge on iron trafficking in erythroid cells, present emerging roles of the transferrin receptor in non-erythroid cells, and summarize recent clinical advances in therapeutic iron supplementation.</p>\n<p>Dr. Mark Fleming will provide an overview of iron trafficking in erythroid precursor cells and will describe how forms of congenital sideroblastic anemia result from genetic defects in this process</p>\n<p>Dr. Nancy Andrews will discuss the role of iron in organs other than the bone marrow, including the diverse functions of the transferrin receptor.</p>\n<p>Dr. Iain Macdougall will briefly discuss the evolution of iron supplementation over the years, from direct parenteral administration of iron salts to the development of iron-carbohydrate complexes and iron nanoparticles. He will also discuss the latest translational science in the development of other iron supplementing strategies, including newer oral iron compounds, such as heme iron polypeptide, ferric citrate, and dialysate iron administration as ferric pyrophosphate citrate, as well as more indirect ways of increasing iron availability, such as a prolyl hydroxylase inhibition (phase III) and anti-hepcidin strategies (phase I and II).",
