					"SessionDescription": "Disorders of primary hemostasis result in mucocutaneous hemorrhage and immediate bleeding following trauma and surgery. Until recently, many of these disorders were diagnostically challenging given limitations in testing. New diagnostic methods may enhance our ability to understand and identify these disorders. Additionally, new approaches and targeted therapies may increase positive outcomes for patients.</p>\n<p>Dr. Veronica Flood will discuss advances in the diagnosis and treatment of von Willebrand disease (VWD). The use of bleeding assessment tools to quantify historical bleeding symptoms as well as the use of new assays of von Willebrand factor function will be highlighted in terms of their effect on diagnosing VWD. New therapeutic options and evidence for specific treatment strategies will also be covered.</p>\n<p>Dr. Patrizia Noris will summarize the most recent advances in understanding hereditary thrombocytopenias, which have been made possible by the large-scale application of next generation sequencing techniques. She will illustrate that the study of large series of patients has revealed that hereditary thrombocytopenias have different degrees of clinical complexity and a great variation in prognosis. In particular, Dr. Noris will discuss forms predisposing to additional illnesses along with the more appropriate diagnostic approach, follow-up, and treatment.</p>\n<p>Dr. Cindy Neunert will provide an overview of recent advances in the management of patients with newly diagnosed immune thrombocytopenia. The indications for treatment and standard first-line therapies will be covered. Dr. Neunert will summarize areas of controversy and existing evidence for corticosteroid selection and augmented treatment.",
