					"Room": "Bldg B, Lvl 5, Murphy BR 3-4",
					"SessionDescription": "The past few years have ushered in major advances in our understanding of the molecular pathogenesis of the myelodysplastic syndromes (MDS). The clinical relevance of these mutations is an evolving story. At the same time, there is an increasing availability of new agents and approaches under investigation for the treatment of these disorders. This session will focus on recent advances in our understanding of the molecular pathobiology of MDS and their impact on risk stratification and outcomes. Speakers will also discuss current therapies for MDS, including novel therapeutic approaches.</p>\n<p>Dr. R. Coleman Lindsley will review current knowledge of the gene mutations involved in the molecular pathogenesis of MDS and the clinical implications of these mutations. He will discuss the prognostic relevance of these mutations and the emerging data on how mutational profiling may predict therapeutic outcome in MDS, including outcome following intensive approaches such as allogeneic stem cell transplantation.</p>\n<p>Dr. Aristoteles Giagounidis will provide an overview of the approach to management of MDS. He will include contemporary approaches to the treatment of lower-risk MDS, including recent data on the use of thrombopoietin mimetics, lenalidomide, and novel agents to ameliorate anemia.</p>\n<p>Dr. Olatoyosi Odenike will review treatment approaches for higher-risk MDS. She will discuss novel strategies under investigation in this context, including novel formulations of hypomethylating agents, novel epigenetic modulators, and other targeted therapeutic approaches and combinations currently under clinical investigation.",
