					"Room": "Bldg C, Lvl 3, Georgia BR 1-3",
					"SessionDescription": "There have been tremendous advances in the field of myeloproliferative neoplasms (MPN) since the discovery of the <i>JAK2V617F</i> mutation 12 years ago. This breakthrough has generated refinements in diagnostic criteria and risk assessment and has led to the development of novel therapies. This session will focus on a personalized approach to patients with MPN.</p>\n<p>Dr. Antony Green will review the latest information on the characterization of the molecular landscape of MPN. In particular, he will describe how the unique ordered acquisition of driver mutations and mutations in other genes involved in hematopoietic cell regulation eventually affect the phenotype and fate of the disease. Dr. Green will briefly discuss how the understanding of mutation order might potentially affect therapeutic approach.</p>\n<p>Dr. Alessandro Vannucchi will summarize current criteria for managing patients with polycythemia vera and essential thrombocythemia, using risk stratification criteria and adapting treatment accordingly. He will discuss results of the latest clinical trials that form the fundamental therapy as well as the use of novel drugs in selected patient categories.</p>\n<p>Dr. Claire Harrison will discuss challenges in managing patients with myelofibrosis using the approved <i>JAK1</i> and <i>JAK2</i> inhibitor ruxolitinib, as well as how this drug is best positioned in a therapeutic algorithm that includes conventional agents, a watch-and-wait approach, and stem cell transplantation. She will review the results of clinical trials with other <i>JAK2</i> inhibitors and discuss novel drugs in early clinical development.",
