					"SessionDescription": "This workshop and networking reception will provide an opportunity for female hematologists to gather in an informal environment. The goal of the event is to facilitate an exchange between senior and more junior hematologists in an effort to cultivate mentoring. The emphasis of this year’s program underscores the importance of being proactive. In addition to remarks from the co-chairs, participants will work in small groups, led by more senior hematologists, to discuss strategies to address real-life challenges that participants will identify in advance.</p>\n<p><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSe2RY0EraiGQrzXAINEokiWmv1M2PM_0Qt7HQ7rcUErqZMn5Q/viewform\">RSVP online</a>",
