					"Room": "Bldg C, Lvl 1, Hall C4",
					"SessionDescription": "The immune system has evolved over millions of years to respond to a vast array of infectious pathogens. However, over the past decade the increasing resistance of bacteria, fungi, and viruses to standard therapies have challenged researchers to better understand how to exploit the innate and adaptive immune response to better treat infectious disease. This session will focus on cutting-edge approaches to better understand current concepts regarding host-pathogen interactions.</p>\n<p>Dr. Mark Davis will describe the response of adaptive immune cells at the single cell level to bacterial and viral pathogens.</p>\n<p>Dr. Sarah Gaffen will discuss the multifaceted role of IL-17 in immune responses. IL-17 drives pathology in a number of autoimmune conditions, and biologic therapies targeting the IL-17/Th17 pathway have shown impressive success in the clinic. Conversely, IL-17 is a central driver of immunity to infections, particularly those caused by the commensal fungus Candida albicans. In this session, Dr. Gaffen will discuss recent advances in the IL-17 signal transduction pathway, with an emphasis on the role of IL-17 in driving autoimmunity and protecting from mucosal candidiasis.</p>\n<p>Dr. Antonio Lanzavecchia will discuss how the analysis of the human antibody response can reveal fundamental mechanisms and provide new tools to fight pathogens. Cell culture-based methods are used to interrogate memory B cell repertoires and to isolate antibodies selected on the basis of their neutralizing potency and breadth. These antibodies are candidates for prophylaxis and therapy of infections and represent useful tools for vaccine design. The genealogical analysis of B cell clones is used to dissect the role of somatic mutations in affinity maturation, diversification, and in the generation of autoantibodies. The systematic analysis of the antibody response to malaria-infected erythrocytes has led to the surprising discovery of a new mechanism of antibody diversification, which relies on templated insertions of genomic DNA sequences into immunoglobulin genes.",
