					"Room": "Bldg B, Lvl 4, B401-B402",
					"SessionDescription": "It has long been recognized that platelets play an important role in the regulation of tumor growth and metastasis into the vascular space. However, the underlying mechanisms by which the platelet-tumor interaction is mediated and how this aids in tumor extravasation and re-seeding has remained elusive. Platelets release a number of signaling proteins, molecules, and metabolites. In particular, the lipids released from the platelet help mediate tumor growth and metastasis in an ever-expanding and complex mechanism. Further, platelet extravasation into the tumor microenvironment is thought to play an extremely important role in tumor growth; and focal adhesion kinase (FAK) has recently been shown to be a driver in this process. A better understanding of these complex mechanisms will aid in future development of anti-platelet and/or anti-metastatic therapies limiting tumor growth and extravasation.</p>\n<p>Dr. Tatiana Byzova will discuss platelet lipids and their regulation of tumor growth and metastasis, as well as recent findings.</p>\n<p>Dr. Elisabeth Battinelli will discuss platelet angiogenic potential in platelet-mediated metastasis. Additionally, the role of tamoxifen in regulating this process will be discussed.</p>\n<p>Dr. Anil Sood will discuss the role of platelet extravasation into the tumor microenvironment in stimulating tumor growth following cessation of anti-angiogenesis therapy. His talk will focus on FAK in platelets and its role in platelet migration into the tumor microenvironment.",
