					"Room": "Bldg A, Lvl 4, A411-A412",
					"SessionDescription": "Next-generation sequencing has been instrumental in broadening our knowledge of the genomic landscape of hematologic malignancies, and their application as diagnostic and prognostic tools has been rapidly expanding. This session will focus on the utility of NGS in the routine hematologic practice. </p>\n<p>Dr. Kojo Elenitoba-Johnson will discuss the factors that can affect the effective implementation of NGS-based testing in the clinical laboratory, with particular focus on hematologic malignancies. This will include understanding the parameters affecting selection of platforms, providing considerations for disease-based panels or broad/exome-wide analyses and for clinical decision support. Dr. Elenitoba-Johnson will also address challenges in setting up large-scale genomic sequencing assays deployed in a variety of laboratory settings.</p>\n<p>Dr. Elaine Lyon will discuss the rapid evolution of genomic testing. She will address professional guidelines available to laboratories to establish quality metrics. In addition, Dr. Lyon<b> </b>will address expectations of data quality and elements of reporting identified variants and their interpretation. She will also discuss the molecular community’s efforts to address consistency in using guidelines. </p>\n<p>Dr. Torsten Haferlach will discuss which NGS option (single genes, panels, whole exome sequencing, whole genome sequencing, RNA sequencing) may be ready for real-time precision medicine. The use of whole exome sequencing will be discussed in detail. Important issues that require attention include instruments, assays, coverage, bioinformatic support for data curation, clinically relevant reporting, and advice for treatment decisions, if actionable. All these chain links are mandatory to allow clinical applicability. Dr. Haferlach will address recent advantages in using whole-exome sequencing for clinical decision making and will define and predict steps for the near future.",
