					"Room": "Bldg B, Lvl 5, Murphy BR 1-2",
					"SessionDescription": "Epigenetic modifications help guide developmental fate decisions in hematopoiesis, and disruption of the epigenome is a common feature in a variety of hematopoietic malignancies. Technological advances have allowed interrogation of the epigenome at an unprecedented resolution. These data present new challenges and opportunities. While we now describe the distribution of these marks in more detail than ever, there is much to be learned about how these epigenetic patterns regulate gene expression and genome organization. Understanding these processes is of critical importance for the development of epigenetic-based therapies in hematopoietic disease.</p>\n<p>Dr.<b> </b>Maria Figueroa will address the role of cytosine methylation in normal aging and leukemias. The DNA methylation pathway is regulated through the function of the DNA methyltransferases and the ten-eleven translocation (TET) proteins. These proteins are frequently mutated in both aging-related clonal hematopoiesis of indeterminate significance (CHIP) as well as in myeloid malignancies. In addition, mutations in <i>IDH1/2</i> can also affect the function of TET proteins. This presentation will explore the normal role of these proteins and how mutations in them interact to impact the epigenetic makeup of normal and malignant cells.</p>\n<p>Dr. Anjana Rao will describe the functions of TET family of enzymes, which oxidize the 5th base, 5-methylcytosine (5mC) to 5-hydroxymethylcytosine (5hmC), and further oxidized derivatives. TET proteins are implicated in numerous biological processes, including neuronal and embryonic development, cell lineage specification, and cancer. Loss-of-function mutations in <i>TET2</i> are frequent in lymphoid and myeloid cancers in humans, and Dr. Rao has shown in mouse models that profound TET loss-of-function resulting from deletion of both the <i>TET2</i> and <i>TET3</i> genes is associated with the rapid and fully penetrant development of aggressive lymphoid and myeloid cancers. These studies, and the underlying mechanisms, will be discussed.  </p>\n<p>Dr. Frank Lyko will elucidate the molecular mechanisms that link RNA methylation to the regulation of protein synthesis and discuss how these mechanisms contribute to the regulation of hematopietic differentiation. RNA methylation represents a novel expansion of traditional epigenetic concepts. Loss of RNA methyltransferase activity in mouse models results in complex cellular differentiation phenotypes, including in the hematopoietic system.",
