					"Room": "Bldg C, Lvl 1, Hall C2-C3",
					"SessionDescription": "Outcomes for patients with multiple myeloma have significantly improved in the recent century, mainly due to the introduction of the first generation of proteasome inhibitors and immunomodulatory drugs as part of firstline therapy. The second generation of these drug classes are emerging as rescue therapy for early relapses and immune-based approaches, as well as new classes of agents that are currently in clinical trials for subsequent relapses. In this session, current and novel strategies of therapy will be reviewed for newly diagnosed and relapsed or refractory multiple myeloma patients.</p>\n<p>Dr. Mari­a-Victoria Mateos will summarize the current treatment algorithm for newly diagnosed myeloma patients, discussing the different options of induction, consolidation, and/or maintenance therapy, including the role of autologous stem cell transplantation.</p>\n<p>Dr. Pieter Sonneveld will discuss the management of relapsed or refractory myeloma patients by presenting all new combinations available for this population and putting them in perspective.</p>\n<p>Dr. Shaji Kumar will review the new classes of agents currently in clinical trials for treatment of myeloma, specifically focusing on the new immune-based approaches, targeted agents, and epigenetic modulators. He will discuss the different immune therapies that are being developed, including monoclonal antibodies and chimeric antigen receptor (CAR) T-cell therapy, as well as other novel immune platforms. Dr. Kumar will discuss the potential targets identified by genomic studies and agents that are being explored in the context of specific plasma cell abnormalities, as well as ongoing trials of target-based treatment assignment.",
