					"ReviewCategoryTitle": "Friday Scientific Workshop on Hematology and Aging: Highlighting Novel Science and Promoting a Research Agenda",
					"Room": "Bldg B, Lvl 2, B216-B217",
					"SessionDescription": "As the number of older patients with hematologic disorders dramatically increases, an enhanced focus on aging is needed.  The Workshop on Hematology and Aging will discuss scientific findings related to aging and hematologic disorders, and will span topics from bench to bedside. This interactive workshop is not disease specific but will consider common themes related to aging in multiple settings. The workshop will include research on stem cells and aging, implications of aging on immune function (immunosenescence, immune reconstitution), thrombosis and aging, and correlates of frailty in hematology. Topics will cut across basic and clinical areas, as well as across disease types and clinical fields. Emphasis will be made on biologic mechanisms and implications for translation of clinical observations to pre-clinical models. The target audience for this workshop is laboratory-based investigators and clinical researchers with an interest in aging and hematology. The expansive content, thematic focus, and interactive format will also appeal to a broader audience including students and trainees.</p>\n<p>Workshop Objectives:</p>\n<ol>\n<li>Provide a forum within ASH for presentation of novel research related to the biology of aging and hematologic disorders</li>\n<li>Promote discussion of a research agenda: what are the highest priority questions and new approaches needed to answer them?</li>\n<li>Highlight opportunities for collaboration.</li>\n</ol>\n<p>This interactive workshop will feature brief didactic presentations from speakers on key topics followed by a few minutes of Q&A.",
