					"ReviewCategoryTitle": "Friday Scientific Workshop on Hemoglobin Concentrations for Defining Anemia in Individuals and Populations",
					"Room": "Bldg B, Lvl 2, B213-B214",
					"SessionDescription": "Accurate case definition of anemia is critical for clinical diagnosis, to enable patient care, and for understanding the epidemiology of this problem to plan public health interventions. Appropriate definitions of anemia are therefore crucial for both clinical and public health medicine. Current hemoglobin thresholds the World Health Organization (WHO) recommends for men, women, young children, and pregnancy were proposed in 1968. However, concerns have been raised about the suitability of the current thresholds. WHO, in collaboration with the US Centers for Disease Control and Prevention (CDC) are reviewing the evidence underlying current thresholds and undertaking a program of research to help ensure these thresholds are appropriate. The hematology community comprise the most important clinical stakeholder group and are the group with technical expertise to support this program. It is therefore crucial that hematologists have an opportunity to be informed about and to provide input into this process. This workshop will present key scientific data underlying the process, and will provide an open forum for hematologists to discuss the data and further research plans. It will also provide a forum for new basic science and epidemiology surrounding anemia at the clinical and population health level to be presented and discussed.<span> </span></p>\n<p>Workshop Objectives:</p>\n<p> </p>\n<ol>\n<li>To outline the rationale and process for review and revision of the WHO hemoglobin thresholds.</li>\n</ol>\n<p> </p>\n<ol start=\"2\">\n<li>To identify and present key data which could provide the evidence that would be needed to define WHO hemoglobin thresholds.</li>\n</ol>\n<p> </p>\n<ol start=\"3\">\n<li>To present key scientific and experimental data which may inform the process by which hemoglobin thresholds should be defined by WHO.  </li>\n</ol>\n<p> </p>\n<ol start=\"4\">\n<li>Deliver a highly interactive workshop, with a strong focus on collaboration between the hematology community and the WHO process.</li>\n</ol>\n<p> </p>\n<ol start=\"5\">\n<li>To provide feedback to WHO from the hematology community based on discussions and outcomes of the meeting.</li>\n</ol>\n<p>The format of this workshop will comprise an overview of the problem and the topic, followed by a series of didactic presentations accompanied by time for questions and answers. This will include both a series of public health related research presentations focusing on anemia, as well as basic biology/ laboratory based presentations focusing on iron metabolism and erythroid biology as it relates to this question. Both data presented at the WHO meeting held in Geneva and supporting, basic data will be presented. At the conclusion of the presentations, the chairs will summarize the key points presented, and allow further time for more general questions and answers, followed by a final summing up. This workshop is directed at laboratory-based investigators, clinicians, trainee hematologists interested in anemia and individuals interested in the guideline development process at the World Health Organization.",
					"SessionTitle": "Opening Remarks",
					"SessionType": "Oral",
					"Sponsor": "",
					"StartTime": "1:00:00 PM",
					"TitleNote": "",
					"_disposition": "INSERT"
