					"ReviewCategoryTitle": "Friday Scientific Workshop on Inherited Hematopoietic Malignancies ",
					"Room": "Bldg B, Lvl 2, B211-B212",
					"SessionDescription": "Genetic contribution to the development of hematopoietic malignancies and the need for understanding predisposition genes, mutation distributions, and clinical phenotypes continues to be of great interest to the hematology community. The Workshop on Inherited Hematopoietic Malignancies will discuss the scientific advances in understanding the pathogenesis of cancer development in individuals and families with germline mutations and predisposition to bone marrow derived malignancies. The workshop will concentrate on known familial syndromes, including germline RUNX1, ETV6, ANKRD26, DDX41, GATA2, CEBPA, and other mutations that predispose to myeloid malignancies. The workshop will also discuss other well described syndromes such as Li-Fraumeni germline TP53 mutations as well as inherited lymphoid malignancies and pedigrees of high interest that have no known genetic predisposition alleles identified. The workshop will be conducted with an interactive format, encouraging input from audience members. Although the main focus of the workshop will be scientific in nature, discussions will also emphasize the clinical identification of individuals and families. This workshop will appeal to clinicians who have an interest or are studying inherited hematopoietic malignancies.</p>\n<p>Workshop Objectives:</p>\n<ol>\n<li>To discuss on-going research efforts in specific predisposition syndromes.</li>\n<li>To strengthen existing and to develop new collaborations in these diseases.</li>\n<li>To discuss interesting pedigrees that have tested negative for all known predisposition alleles to date and to combine pedigrees with similar phenotypes.</li>\n<li>To inform ASH members who are clinicians about these predisposition syndromes and provide contacts to facilitate testing/expand research.</li>\n<li>To discuss sequencing approaches, limitations, timing, and circumstances for variant evaluation.</li>\n</ol>\n<p>This workshop is designed to be very interactive to allow for maximal interaction and collaborations based on similar interests. The format will include didactic sessions with opportunities for Q&A.",
