					"ReviewCategoryTitle": "Friday Scientific Workshop on Myeloid Development ",
					"Room": "Bldg A, Lvl 4, Marcus Aud.",
					"SessionDescription": "The Workshop on Myeloid Development will examine the latest scientific findings in myeloid biology in a highly interactive environment that permits exchange of ideas among investigators.  The workshop will focus on topics such as; hematopoietic stem cell biology, leukemogenesis, cell signaling, transcription factors, epigenetic effects, and other topics related to myeloid biology.  Each session leader will briefly summarize the current questions facing the field and then lead discussions on how best to answer those questions.  New findings or novel techniques that provide insight into these questions will be an essential part of all discussions.  The research presented at this workshop will also focus on the use of molecular biology and biochemistry tools, as well as animal models to address the core topics; it will not include any purely clinical, epidemiologic, or population based approaches. This workshop is directed at laboratory-based investigators, but the broad-ranging content and highly interactive format is suitable for clinically oriented investigators and is particularly appealing to young investigators, giving them the opportunity to interact directly with experts in the field.</p>\n<p>Workshop Objectives:</p>\n<ol>\n<li>Discuss the latest scientific developments in hematopoietic stem cell biology, leukemogenesis, cell signaling, transcription factors and epigenetic effects, and other topics related to myeloid biology.</li>\n<li>Have interactive presentations by world-class scientists.</li>\n<li>Provide young investigators opportunities to interact with world-renowned experts in the field.</li>\n</ol>\n<p>The format of this workshop will include brief didactic sessions followed by a couple minutes of Q&A. Sessions and session leaders are as follows:",
