					"Room": "Bldg B, Lvl 3, B312-B314",
					"SessionDescription": "The area of immunotherapy in lymphoid malignancies has exploded in recent years.  Multiple new immune therapies are in development in lymphoproliferative diseases, and this exciting progress has been due to an increased understanding of the tumor microenvironment and tumor-immune interactions in these diseases.  This proliferation of scientific knowledge has led to multiple potential new treatments including new immune checkpoint blockade therapies, novel T-cell approaches, agents targeting monocytes and macrophages, as well as new approaches inhibiting immune receptors and cytokine signaling.  The Workshop on Tumor Immune Interactions in Lymphoid Malignancies is directed at scientists, researchers, industry partners and clinicians interested in immune approaches for the management of lymphoid malignancies</p>\n<p>Workshop Objectives</p>\n<ol>\n<li>Highlight novel basic science and translational immune research in lymphoid malignancies that are likely to translate in the near future to clinically relevant therapies, biomarkers, or correlative science.</li>\n<li>Highlight potential future therapies or therapeutic targets that are likely to be important in lymphoid malignancies.</li>\n<li>To have scientists, translational researchers, and clinicians “hear it here first” when it comes to the next big thing in the management of lymphoid diseases.</li>\n</ol>\n<p>The format of this workshop will be different from sessions in the annual ASH meeting in that it will be strictly immune focused, highly interactive and somewhat speculative (though based on science), with a strong focus on future translation to the clinic.",
