					"SessionDescription": "Next generation sequencing allows the identification of causative heterozygous mutation for primary immunodeficiency in sporadic cases. In this session, we will hear several examples for genes causing diseases in a heterozygous state. The clinical phenotype of patients can be variable and I would like to emphasis that patients with primary immunodeficiency might not only be diagnosed during childhood but also as young adults or adults because of complications as cancer or autoimmunity.</p>\n<p>Dr. Anne Durandy will start this session with a talk focusing on the clinical and immunological phenotypic and genetic heterogeneity of recently molecularly characterized PADs, among them the activated PI3K delta syndromes (APDS) and the NFkB-deficiencies.</p>\n<p>Dr. Troy Torgerson will present the current therapeutic approaches used to treat disorders associated with dysfunction in the regulatory T cell and will discuss insights gained by characterizing these PID into Treg development and function.</p>\n<p>Dr. Jennifer Puck will present examples for diagnoses made for infants discovered to have T cell insufficiency by newborn screening. She will explain how variants found by deep sequencing were proven to be disease-causing in <em>in vitro</em> and<em> in vivo</em> studies.",
