					"Room": "Bldg A, Lvl 4, Marcus Aud.",
					"SessionDescription": "In response to long-standing member interest, ASH initiated an effort in 2014 to develop evidence-based clinical practice guidelines for hematology that meet the highest standards of development rigor and trustworthiness. The first ASH guidelines in development under this effort are a set of 10 guidelines on the prevention, treatment, and diagnosis of venous thromboembolism (VTE). Development of the guidelines, including systematic evidence review, is supported by the McMaster University GRADE Center.</p>\n<p>As part of the VTE guideline development process, more than 100 thrombosis experts across 10 VTE guideline panels reviewed evidence and formulated more than 200 recommendations on VTE. In this session, the chairs of each of the 10 panels will present key recommendations from the upcoming chapters and enumerate the various Education Program sessions that will touch on these recommendations.",
