					"SessionDescription": "New therapeutic approaches to treat bleeding and thrombosis due to a variety of pathological conditions are needed. This session will present new biochemical findings into the hemostatic system that have unveiled promising molecular targets to treat these conditions. These strategies include targeting the protein C pathway for hemophilia, selectively inhibiting platelet activation, and blocking the contact pathway to prevent thrombosis.</p>\n<p>Dr. James Huntington will explain his approach for targeting the protein C anticoagulant system. Blood coagulation is regulated by a complex network of pro- and anti-coagulant factors that work simultaneously to ensure rapid, stable clot formation at sites of vascular damage, while limiting clot grown to prevent thrombosis. Deficiency in pro-coagulant factors VIII and IX cause hemophilia A and B, respectively, and result in bleeding due to an imbalanced hemostatic system. All current treatments aim to rebalance the system by replacing the missing factors or by adding other pro-coagulant factors. A more recent approach is to redress the imbalance by down-tuning anticoagulant forces. Anti-TFPI antibodies and an anti-antithrombin siRNA are in the clinic as treatments for hemophilia. Dr. Huntington will discuss how his lab designed a serpin that is specific for activated protein C (APC) over other clotting factors and will show preclinical data on efficacy and safety in mouse models.</p>\n<p>Dr. Steve Watson will discuss the role of the tyrosine kinase-linked receptors GPVI and CLEC-2 in hemostasis and thrombosis, and whether they represent novel drug targets in thrombotic disease. The two receptors can be targeted by direct inhibition or through their tyrosine kinase-driven signalling pathways. Inhibitors of Src, Syk, and Tec family kinases have recently entered the clinic or are under clinical development. There is particular interest in the Btk inhibitor ibrutinib and in the next generation of inhibitors because of their irreversible action. By analogy to aspirin, this offers the potential of using a low dose of ibrutinib to selectively inhibit platelet activation. Unexpectedly, ibrutinib selectively inhibits platelet activation by CLEC-2 relative to GPVI. The molecular basis of this will be discussed.</p>\n<p>Dr. David Gailani will discuss the roles of the plasma proteins prekallikrein, factor XII, and factor XI (the contact factors) in thrombosis, with an emphasis on coagulation induced by artificial surfaces (e.g., extracorporeal circuits and implantable devices). Given the limited contributions of these proteins to hemostasis, it is anticipated that antithrombotics targeting them would be associated with a low risk of bleeding. Recent work suggests that the contact factors express protease activity in their single-chain precursor forms. This activity may serve as a trigger for the contact system when blood is exposed to a surface.",
