					"SessionDescription": "Platelets play many different roles. Billions of platelets are produced daily, with complex mechanisms regulating production as well as clearance. Senescent, desialylated platelets are cleared through pathways involving the hepatic Ashwell-Morell receptor, whereas the spleen plays a key role in antibody-mediated platelet clearance. Although the majority of platelets transfused are currently stored at room temperature, refrigerated, cryo-preserved, and even freeze-dried platelets are showing metabolic and functional promise as transfusion products. This session will review endogenous and transfused platelets, from production to destruction.</p>\n<p>Dr. Karin Hoffmeister will discuss mechanisms of endogenous platelet clearance, including the impact of this clearance on the regulation of thrombopoietin.</p>\n<p>Dr. Andrew Cap will review storage options for platelets, and will discuss the impact of refrigerated storage, cryo-preservation, and lyophilization on cellular physiology.   </p>\n<p>Dr. John Semple will discuss the role that the spleen plays in platelet clearance and thrombocytopenia.",
