					"Room": "Bldg B, Lvl 5, Murphy BR 1-2",
					"SessionDescription": "T cell exhaustion is the acquired state of dysfunction characteristic of the T cell response to cancer and chronic viral disease.  Efforts to reverse T cell exhaustion have led the development of immune checkpoint blockade (ICB) therapies targeting, among others, the PD-1 immunoinhibitory receptor expressed by exhausted T cells.  Despite the dramatic clinical results with this new class of cancer therapies, only the minority of patients have sustained clinical benefit from ICB.  Thus improving cancer immunotherapy will require additional understanding of the differentiation of exhausted T cells and the role of the negative signaling molecules they express. </p>\n<p>Dr. Rafi Ahmed will review studies of the differentiation of T cells in response to acute and chronic viral pathogens and tumors.  He will describe recent developments that have led to the increased appreciation of functionally distinct subsets of exhausted T cells that help inform the rational design of immunotherapy aimed at reversing T cell exhaustion.</p>\n<p>Dr. Arlene Sharpe will discuss the biology behind checkpoint blockade. She will focus on the immunoregulatory functions of the PD-1 pathway in regulating T cell activation, tolerance, resolution of inflammation, and anti-tumor immunity. She will discuss recent mechanistic studies that explain PD-1 pathway functions in cancer.</p>\n<p>Dr. Dario Vignali will discuss the biology of the inhibitory receptor LAG3, and its contribution to T cell exhaustion and immune regulation on CD8+ and CD4+ intratumoral T cells in mouse models of cancer and autoimmunity, and in a variety of human malignancies.  He will also discuss the impact of LAG3 on regulatory T cell function.  He will also discuss how differential LAG3 expression could impact responsiveness to immunotherapy.",
