					"SessionDescription": "Areas under active investigation in the field of<b> </b>immunotherapy for lymphoma include vaccines enhancing antigen processing and presentation efficacy, co-stimulation agonists, adoptive transfer of genetically modified T cells, and suppression of T cell regulatory pathways. This session will focus on the biology of the microenvironment, as well as immunomodulators, immune checkpoint inhibitors, and cell therapy for lymphoma.</p>\n<p>Dr. Karin Tarte will discuss the heterogeneity, origin, and function of the tumor microenvironment in B-cell non-Hodgkin lymphoma (NHL), including adaptive and innate immunity as well as cancer-associated fibroblasts. She will review how these various cell subsets may favor or restrain malignant cell growth. Dr. Tarte will also highlight the implications for lymphomagenesis and treatment design.</p>\n<p>Dr. Stephen Ansell will review immunological barriers to an effective antitumor immune response in lymphoma. He will discuss clinical results with immune modulation, including studies using immune checkpoint blockade and agonistic monoclonal antibodies. Dr. Ansell will also discuss preliminary results with combination immunological approaches.</p>\n<p>Dr. Catherine Bollard will discuss T-cell therapies for lymphomas beyond chimeric antigen receptor (CAR) T cells, including T cells specific for tumor-associated and viral antigens. She will also discuss mechanisms to render T cells resistant to suppressive elements in the tumor microenvironment.",
