					"SessionDescription": "There has been great progress in the treatment of multiple myeloma, largely due to our ability to explore normal plasma cell biology through novel therapeutics. Plasma cells are committed to certain differentiation that creates vulnerabilities that are now being successfully exploited therapeutically as cancer treatments. Understanding this normal plasma cell biology has, therefore, become of paramount importance. Central to this understanding is the critically important process of protein metabolism and its associated signaling. In this session, speakers will review normal plasma cell biology as a way to better understand current paradigms for the treatment of myeloma.</p>\n<p>Dr. Katia Georgopoulos will discuss the basic biology of normal plasma cells and how it is key to understanding the mechanisms of action of various anti-myeloma therapies. She will review the normal maturation process leading to long-lived plasma cells, including the key role played by Aiolos. Dr. Georgopoulos will also discuss the key role of Ikaros regulations of plasma cells and their interaction with the bone marrow microenvironment, a process that is likely critical for long-term survival.</p>\n<p>Dr. Lawrence Boise will discuss the biology of protein homeostasis as it pertains to myeloma cell growth and survival. Like normal plasma cells, myeloma cells produce and secrete copious amounts of antibodies, a process that is reliant on quality control mechanisms within the cell. This includes the ubiquitin proteasome system, a key target of myeloma therapy. In addition to immunoglobulins, key proteins in plasma cell survival are regulated post-transcriptionally, including transcription factors and members of the BCL2 family. New findings and clinical implications of targeting protein homeostasis will be discussed.</p>\n<p>Dr. Florian Bassermann will present recent mechanistic insights on cereblon (CRBN) functions and their link to metabolic processes such as the redox balance and lactate homeostasis. These insights will be discussed in the context of IMiD biology, the establishment of predictive biomarkers for IMiD response, and the design of new anti-myeloma drugs.",
