					"Room": "Bldg B, Lvl 5, Murphy BR 3-4",
					"SessionDescription": "Apheresis is a term for procedures where blood is removed from a patient, modified or manipulated, and then returned.  In this session, the use of plasma exchange (TPE) in two clinical applications as well as the use of extracorporeal photochemotherapy (ECP), also known as photopheresis, will be discussed as immunomodulatory therapies.\n\nDr Jeffrey L Winters will discuss the role of TPE in the treatment of thrombotic microangiopathies (TMA) other than thrombotic thrombocytopenic purpura (TTP).  TPE has been applied to numerous entities solely based on the response seen in TTP.  Does this make sense in such diverse disorders as TMA-Shiga toxin associated, TMA-complement mediated, TMA-hematopoietic stem cell associated, TMA-drug associated, and HELLP syndrome?  The role of TPE in these and other TMA will be presented.\n\nDr Jennifer Schneiderman will describe the role of ECP in the treatment of graft-versus-host disease.  She will review the procedure as well as discuss the possible mechanisms of action of ECP in modulating the cellular immune system.  How does ECP work and what are the risks and benefits of this treatment?\n\nDr Douglas E Gladstone will describe the role of TPE in desensitizing allogeneic stem cell transplant patients who have antibodies to human leukocyte antigens (HLA) present on their donor.  He will review the testing required to identify the presence of these antibodies, the protocol behind desensitization, and how testing determines when desensitization has succeeded and transplantation can proceed.  Outcomes and experiences from his practice will be presented.\n\nThis session is jointly sponsored with AABB.",
