					"ReviewCategoryTitle": "Friday Scientific Workshop on Hematology and Aging: Highlighting Novel Science and Promoting a Research Agenda",
					"Room": "Bldg B, Lvl 2, B216-B217",
					"SessionDescription": "Aging is a risk factor for thrombosis, yet the molecular and functional changes that occur during aging to drive this increased risk remain poorly understood.  As the number of older adults is predicted to continue to rise, this will become an increasingly common public health problem, with associated morbidity and mortality.  Filling these knowledge gaps is critical for improving the prevention and treatment of arterial and venous thrombosis in older adults.\n\nDr. Rondina will discuss changes in the platelet molecular signature that occur during human aging.  He will highlight ongoing work on dissecting the regulation and function of specific genes whose expression are altered in older adults and impacting thrombo-inflammation.\n\nDr. Wolberg will discuss In vitro and in vivo models used to dissect the pathophysiology of thrombosis in aging.  She will highlight how these models recapitulate, in some settings, human thrombosis and provide insights into the pathobiology of thrombosis in aging.\n\nDr. Davizon-Castillo is an emerging young investigator who will discuss his ongoing work dissecting how inflammation during aging results in a hyper-active platelet phenotype, causing enhanced thrombosis that is TNF-alpha driven.  He will also highlight how RNA sequencing of megakaryocytes in aging yields discoveries on molecular reprogramming driving altered platelet function and thrombo-inflammation.",
