					"Room": "Bldg B, Lvl 2, B206",
					"SessionDescription": "In this session, speakers will review recent advances that allow more physiologic modeling of <i>in vivo </i>thrombosis as well as exciting engineering developments that may improve our ability to treat and/or prevent thromboembolism.</p>\n<p>Dr. Wilbur Lam will describe how microchip-based technologies have enabled the development of “endothelialized” microfluidic devices to model clot formation under physiologic flow conditions in vitro. With the capability to recapitulate the shear forces and endothelial-blood cell interactions of the in vivo vascular microenvironment and inclusion of human and patient blood samples, these perfusable microsystems serve as versatile research-enabling and drug discovery platforms for hemostasis and thrombosis applications. In this session, seminal studies leveraging thrombosis-on-a-chip systems as well as recent advances and limitations of these technologies will be discussed</p>\n<p>Dr. Keith Neeves will review experiments showing that low-strength magnetic fields can reversibly assemble wheel-shaped devices from individual colloidal building blocks and ablate thrombi using a combination of mechanical and chemical lysis. These wheel-shaped entities can then be driven, rotated, and directed along surfaces at velocities faster than most other microscale propulsion schemes. Possible future clinical applications of this concept will be discussed.</p>\n<p>Dr. Jeffrey Lawson will describe vessels that are grown using banked human vascular cells and then de-cellularized so that they can be implanted into any patient, without tissue matching. These vessels have been evaluated in two phase II studies of patients with end-stage renal disease (ESRD). The studies have shown that these vessels repopulate and remodel with host cells, can withstand multiple re-cannulations, and might have a resistance to infection comparable to that expected for native arteriovenous fistulas.",
