					"Room": "Bldg B, Lvl 4, B405-B407",
					"SessionDescription": "Allogeneic hematopoietic cell transplantation (alloHCT) is a potentially curative therapy for many patients with a hematologic malignancy. However, relapse remains the leading cause of treatment failure, and optimal treatment for relapse after alloHCT is still poorly defined. Historically, besides donor lymphocytes infusion, limited therapeutic options have been available for these patients, and they have typically faced very poor prognoses. However, a better understanding of the pathophysiology of disease relapse after alloHCT – and the introduction of several novel targeted drugs and cellular therapies that can be safely used after alloHCT – may improve the outcome of these patients.</p>\n<p>Dr. Frederik Falkenburg will provide a modern vision of the so-called immune-mediated graft versus tumor effect, and he will summarize the latest developments related to the understanding of the biology of disease relapse after alloHCT.</p>\n<p>Dr. Robert Soiffer will describe the bases for a rational deployment of post-transplant therapies using pharmacologic agents. He will also summarize the available research evidence, including safety and efficacy, related to the use of some targeted drugs after alloHCT to prevent or treat disease recurrence.</p>\n<p>Dr. Alan Wayne will focus on the use of cellular therapies to prevent or treat disease relapse after alloHCT. He will provide an update on the latest results and address the different challenges encountered in this domain.",
